function getdata() {
  return fetch('https://kontests.net/api/v1/all')
  .then((response) => response.json())
  .then((responseJson) => {
    return responseJson;
  })
}

function App() {
  var text = "hemlo";
  getdata();
  return text;
}

export default App;
